import React, { useEffect, useState } from "react";
import axios from "axios";
import TopBar from "../components/TopBar";
import dayjs from "dayjs";

function TablingLogs() {
  const [logs, setLogs] = useState([]);
  const [groupedLogs, setGroupedLogs] = useState({});

  useEffect(() => {
    const fetchLogs = async () => {
      try {
        const res = await axios.get("/api/organizations");
        const allLogs = [];

        for (const orgName of res.data) {
          const orgRes = await axios.get(`/api/organizations/${encodeURIComponent(orgName)}`);
          const reservations = orgRes.data.reservations.map((r) => ({ ...r, organization: orgRes.data.name }));
          allLogs.push(...reservations);
        }

        const grouped = {};
        allLogs.forEach((entry) => {
          if (!entry.eventNumber) return;
          if (!grouped[entry.eventNumber]) grouped[entry.eventNumber] = { check_in: null, check_out: null, no_show: null };
          grouped[entry.eventNumber][entry.action] = entry;
        });

        setGroupedLogs(grouped);
      } catch (err) {
        console.error("Failed to load logs", err);
      }
    };

    fetchLogs();
  }, []);

  return (
    <div className="min-h-screen bg-gray-900 text-white p-6">
      <TopBar />
      <h2 className="text-3xl font-bold text-center text-asuGold mb-6">Tabling Logs</h2>

      {Object.keys(grouped).length === 0 ? (
        <p className="text-center text-white/70">No tabling logs found.</p>
      ) : (
        Object.entries(grouped).map(([eventNumber, logs]) => {
          const org = logs[0].org;
          const checkIn = logs.find((log) => log.action === "check_in");
          const checkOut = logs.find((log) => log.action === "check_out");
          const noShow = logs.find((log) => log.action === "no_show");

          return (
            <div key={eventNumber} className="bg-gray-800 border border-gray-600 rounded-xl p-5 mb-5 shadow">
              <h3 className="text-xl text-asuGold font-semibold mb-2">{eventNumber}</h3>
              <p><span className="font-bold text-white">Organization:</span> {org}</p>
              <p><span className="font-bold text-white">Tabling Spot:</span> {checkIn?.tablingSpot || checkOut?.tablingSpot || noShow?.tablingSpot || "-"}</p>

              {checkIn && (
                <>
                  <p><span className="font-bold text-white">Client Name:</span> {checkIn.clientName}</p>
                  <p><span className="font-bold text-white">Checked In By:</span> {checkIn.user}</p>
                  <p><span className="font-bold text-white">Check-In Time:</span> {new Date(checkIn.checkInTime).toLocaleString()}</p>
                  <p><span className="font-bold text-white">Tables:</span> {checkIn.table ? "1" : "0"}</p>
                  <p><span className="font-bold text-white">Chairs:</span> {checkIn.chairs?.length || 0}</p>
                </>
              )}

              {checkOut && (
                <>
                  <p><span className="font-bold text-white">Checked Out By:</span> {checkOut.user}</p>
                  <p><span className="font-bold text-white">Check-Out Time:</span> {new Date(checkOut.checkOutTime).toLocaleString()}</p>
                  <p><span className="font-bold text-white">Notes:</span> {checkOut.notes || "N/A"}</p>
                </>
              )}

              {noShow && (
                <>
                  <p><span className="font-bold text-white">No-Show Logged By:</span> {noShow.user}</p>
                  <p><span className="font-bold text-white">Time Range:</span> {new Date(noShow.rangeStart).toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' })} - {new Date(noShow.rangeEnd).toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' })}</p>
                </>
              )}
            </div>
          );
        })
      )}
    </div>
  );

}

export default TablingLogs;
